window.bookSummaryJSON = "<p><b>Lenora De Luca</b><br> <br> I've always been a good girl.<br> The perfect daughter.<br> The perfect sister.<br> And, in two weeks, I'm supposed to become the perfect wife.<br> I don't know or like the man my father chose to marry me off to but I have no say in the matter.<br> That's why when I see Rocco Marchetti, the man I've had a crush on my entire life, I decide he'll be my first.<br> When he looks at me it's electric and I know he wants me.<br> We keep stealing glances and hiding smiles, but I want more.<br> I want one night with him.<br> So what if I'm the daughter of the most feared man in organized crime?<br> So what if he's my overprotective brother's best friend?<br> It's just one night.<br> <br> <b>Rocco Marchetti</b><br> <br> Lenora De Luca is as forbidden as they get.<br> She's also kind, and thoughtful, and makes my d...makes it hard to think.<br> It starts off innocent enough, just flirting, but then she kisses me and tells me she wants to spend one night with me.<br> It's wrong on so many levels, but I don't even try to deny that I want her.<br> I tell myself that it'll be her wedding present (I know I'm sick, get over it).<br> I've had plenty one nightstands that end amicably.<br> Lenora can't possibly be any different.<br> As long as her brother doesn't find out, things will be fine.<br> I usually strategize and think through every decision, but something about her makes me walk right into the fire.</p>"; 
